import React from "react";
import { useState } from "react";
import './Botao.css'

const Botao = props => {
    
    const [reduce, setCount] = useState(10);
    const deduct = () => { setCount(reduce - 1) };
    return (
            <li><button onClick={deduct} >Reservar</button></li>
    )
}

export default Botao
